import React from 'react'
import Order from './Order/Order'

import './Orders.css'

const orders = (props) => {
    
    let allOrders;
    if(props.orders!==null)
    allOrders = props.orders.map(value=>{
        return <Order order={value} />
    })

    return <div className="orders">{allOrders}</div>
}

export default orders
